import './Counter.css' 
import React, {useState} from 'react';

function Counter() {
    const [count, setCount] = useState(0);
    return (
      <div className="Counter">
        <button onClick = {() => setCount(count + 1)}> +1 </button>
        <span className = "count"> {count} </span>
      </div>
    );
  }

  export default Counter;

